const words5 = new Set(words_5);
const words6 = new Set(words_6);
const words7 = new Set(words_7);

export function isWord(word, len){
    if(word.length!==len){
        return false;
    }
    if(len===5){
        return words5.has(word.toLowerCase());
    }
    if(len===6){
        return words6.has(word.toLowerCase());
    }
    if(len===7){
        return words7.has(word.toLowerCase());
    }
}

export function randomWord(len){
    if(len===5){
        return words_5[Math.floor(Math.random()*words_5.length)].toUpperCase();
    }
    if(len===6){
        return words_6[Math.floor(Math.random()*words_6.length)].toUpperCase();
    }
    if(len===7){
        return words_7[Math.floor(Math.random()*words_7.length)].toUpperCase();
    }
}